from pyscipopt import Model, quicksum

def mtz(n, c):
    model = Model("atsp - mtz")
    x, u = {}, {}
    for i in range(1, n + 1):
        u[i] = model.addVar(lb=0, ub=n - 1, vtype="C", name=f"u({i})")
        for j in range(1, n + 1):
            if i != j:
                x[i, j] = model.addVar(vtype="B", name=f"x({i},{j})")

    # Each vertex has exactly one outgoing and one incoming edge.
    for i in range(1, n + 1):
        model.addCons(quicksum(x[i, j] for j in range(1, n + 1) if j != i) == 1)
        model.addCons(quicksum(x[j, i] for j in range(1, n + 1) if j != i) == 1)

    # Miller-Tucker-Zemlin subtour elimination constraints.
    for i in range(1, n + 1):
        for j in range(2, n + 1):
            if i != j:
                model.addCons(u[i] - u[j] + (n - 1) * x[i, j] <= n - 2)

    # Objective: minimize the total cost.
    model.setObjective(
        quicksum(c[i, j] * x[i, j] for i in range(1, n + 1) for j in range(1, n + 1) if i != j),
        "minimize"
    )

    # Save both dictionaries in model.data.
    model.data = (x, u)

    model.optimize()
    return model


